import {Container } from "react-bootstrap";
import "../../style/LandingPage/LandingPageStandings.css";
import StandingsContainer from "./StandingsContainer";
const LandingPageStandings = (standingsName, standingsData) => {
  return (
    <Container>
      <div>
        <StandingsContainer standingsName = "Eastern"/>
      </div>
      <div>
        <StandingsContainer standingsName = "Western"/>
      </div>
    </Container>
  );
};
export default LandingPageStandings;
